import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import './Experience.css'; // Update the CSS file import

const Experience = () => {
  return (
    <section className="experience" id="experience">
      <Container>
        <Row>
          <Col size={12}>
            <h2>Work Experience</h2>
          </Col>
          <Col size={12} className="experience-container">
            {/* Work Experience Items */}
            <div className="experience-item">
              <h3>Software Engineer Intern</h3>
              <p>ABC Tech</p>
              <p>May 2022 - August 2022</p>
              <p>Developed and maintained web applications, collaborated with cross-functional teams, and contributed to project delivery.</p>
            </div>
            <div className="experience-item">
              {/* Add more work experience items here */}
            </div>
          </Col>
        </Row>
      </Container>
    </section>
  );
};

export default Experience; // Rename the component to "Experience"
